module CollectionMethods::TagPredictionInfos
  def self.included(receiver)
    receiver.extend         ClassMethods
    receiver.send :include, InstanceMethods
  end


  module ClassMethods
    
    def generate_all_tags_prediction_infos(options = {})
      # Later, make this to fetch from database ...
=begin      
      posts = Post.all
      posts_count = posts.count
      questioner_experience = User.all.map(&:experience_value).average
      net_question_votes = posts.map(&:question_net_votes_count).sum
      average_question_length = posts.map(&:description).map(&:length).average

      
      all_tags = Tag.all
      all_tags_count = all_tags.count

      centrality_value = 0.00;
      

      all_tags.each_with_index do |tag, index|
        each_tag_centrality_value = 0.00
        associated_tags = tag.associated_tags.where.not(:id => tag.id)

        associated_tags.each do |associated_tag|
          next if tag.id == associated_tag.id

          each_tag_centrality_value += (associated_tag.post_ids & tag.post_ids).uniq.count
        end

        each_tag_centrality_value = (each_tag_centrality_value / associated_tags.count)
        
        centrality_value += each_tag_centrality_value
      
        puts "\n centrality_val -> #{centrality_value}" 
        puts "\n centrality_value_average -> #{centrality_value.to_f / (index + 1).to_f}"

      end

      centrality_value = (centrality_value.to_f / all_tags_count.to_f)

      initial_tag_prediction_info = TagPredictionInfo.new
      initial_tag_prediction_info.posts_count = posts_count
      initial_tag_prediction_info.questioner_experience = questioner_experience.round     
      initial_tag_prediction_info.net_question_votes = net_question_votes
      initial_tag_prediction_info.average_question_length = average_question_length.round
      initial_tag_prediction_info.tag_id = -1;
      initial_tag_prediction_info.centrality = centrality_value.round
      initial_tag_prediction_info.save!
=end


      result_hash = {
        :posts_count=>112329, 
        :questioner_experience=>7.505740409086624, 
        :net_question_votes=>132056, 
        :average_question_length=>180.8488547035939, 
        :centrality_value=>1.0014406677088943
      }
=begin

      result_hash = {
        :posts_count => posts_count,
        :questioner_experience => questioner_experience,
        :net_question_votes => net_question_votes,
        :average_question_length => average_question_length,
        :centrality_value => centrality_value
      }
=end
      all_tags = Tag.all
      all_tags.each do |tag|

        new_tag_prediction_info = TagPredictionInfo.new
        new_tag_prediction_info.tag_id = tag.id
        
        next unless new_tag_prediction_info.valid?

        new_tag_prediction_info = tag.generate_tag_prediction_info(result_hash)
        new_tag_prediction_info.save!
      end
    end

